import {
  SWAP_CARD_FRONT,
  SWAP_CARD_BACK
} from '../constant/action-type';

const initialState = {
    articles: []
  };
  function rootReducer(state = {}, action) {
    switch(action.type){
      case SWAP_CARD_BACK:
        return
    }
    return state;
  };
  export default rootReducer;
